INSERT INTO `book_info` VALUES (40,1,54,'Java从入门到精通','9787302581260','2022-03-06 14:54:14','2022-03-06 14:54:14','明日科技',1,79.8,NULL),(41,1,54,'鸟哥的Linux私房菜 基础学习篇','9787115472588','2022-03-06 15:04:05','2022-03-06 15:04:05','鸟哥',1,118,NULL),(42,-1,54,'鸟哥的Linux私房菜 基础学习篇','9787115472588','2022-03-06 15:06:14','2022-03-06 15:06:14','鸟哥',1,118,'畅销Linux入门书升级版 鸟哥教你从入门到精通 适用Linux系统应用和开发及运维的人员 涵盖linux内核 命令行 嵌入式 Shell与Shell Scripts技巧精粹 基于CentOS 7.x'),(43,-1,54,'鸟哥的Linux私房菜 基础学习篇','9787302581260','2022-03-06 15:08:18','2022-03-06 15:08:18','鸟哥',1,118,'畅销Linux入门书升级版 鸟哥教你从入门到精通 适用Linux系统应用和开发及运维的人员 涵盖linux内核 命令行 嵌入式 Shell与Shell Scripts技巧精粹 基于CentOS 7.x'),(44,0,9,'肖申克的救赎','9787020054985','2022-03-06 15:24:15','2022-03-06 15:24:15','斯蒂芬·金（著）施寄青（译）',1,29.9,'　　《肖申克的救赎》是斯蒂芬·金最为人精精乐道的杰出代表作，收入了他的四部中篇小说。其英文版一经推出，即登上《纽约时报》畅销书排行榜的冠军之位，当年在美国狂销二十八万册。目前，这《肖申克的救赎》已经被翻译成三十一种语言，同时创下了收录的四篇小说中有三篇被改编成轰动一时的电影的记录。其中最为人精精乐道的便是曾获奥斯卡奖七项提名、被称为电影史上最完美影片的《肖申克救赎》（又译《刺激一九九五》）。这部小说展现了斯蒂芬·金于擅长的惊悚题材之外的过人功力。书中的另两篇小说《纳粹高徒》与《尸体》拍成电影后也赢得了很好的口碑。其中《尸体》还被视为斯蒂芬·金具自传色彩的作品。'),(45,0,21,'鸟哥的Linux私房菜 基础学习篇','9787115472588','2022-03-06 15:29:41','2022-03-06 15:29:41','鸟哥',1,118,'畅销Linux入门书升级版 鸟哥教你从入门到精通 适用Linux系统应用和开发及运维的人员 涵盖linux内核 命令行 嵌入式 Shell与Shell Scripts技巧精粹 基于CentOS 7.x'),(46,0,21,'鸟哥的Linux私房菜 基础学习篇','9787115472588','2022-03-06 15:34:06','2022-03-06 15:34:06','鸟哥',1,118,'畅销Linux入门书升级版 鸟哥教你从入门到精通 适用Linux系统应用和开发及运维的人员 涵盖linux内核 命令行 嵌入式 Shell与Shell Scripts技巧精粹 基于CentOS 7.x'),(47,0,21,'鸟哥的Linux私房菜 基础学习篇','9787115472588','2022-03-06 15:35:15','2022-03-06 15:35:15','鸟哥',1,118,'畅销Linux入门书升级版 鸟哥教你从入门到精通 适用Linux系统应用和开发及运维的人员 涵盖linux内核 命令行 嵌入式 Shell与Shell Scripts技巧精粹 基于CentOS 7.x'),(48,0,54,'四级词汇词根+联想记忆法:乱序版 cet4 大学英语四级词汇书 俞敏洪 赠精美笔记本【新东方专营店】','9787511041203','2022-03-06 16:03:56','2022-03-06 16:03:56','俞敏洪',1,48,'《四级词汇词根 联想记忆法：乱序版》是俞敏洪老师编著的经典 词根 联想 系列词汇书之一，已陪伴数百万名考生走过备战四级的岁月，广受读者欢迎。 英语四级考试大纲要求考生掌握4000余个词汇以及相关词组，本书囊括四级新大纲词表所有新增词，删除新大纲词表中已经删除的词汇，紧跟新大纲改革趋势，匹配新版考试大纲词表。打破常规的按字母顺序排列单词的方式，以乱序编排带来学习的新体验。按照听力题型调整要求，本书总结归纳了四级新闻核心词汇，帮助考生从容应对新题型。编者还悉心整理了易考到的超纲单词、熟词僻义表、中学已学单词及词组、不规则动词表，总词汇量已远远超出大纲要求，能帮助广大考生从容应对四级考试中的各个题型，取得满意的成绩。 本书主体部分的核心单词分为35个学习单元，考生可依据自身情况合理安排进度，'),(49,0,9,'灰尘的旅行 ','9787513928663','2022-03-07 22:23:42','2022-03-07 22:23:42','高士其',1,24.8,'无'),(50,0,19,'肖申克的救赎','9787020054985','2022-07-12 02:23:22','2022-07-12 02:23:22','斯蒂芬·金（著）施寄青（译）',1,29.9,'　　《肖申克的救赎》是斯蒂芬·金最为人精精乐道的杰出代表作，收入了他的四部中篇小说。其英文版一经推出，即登上《纽约时报》畅销书排行榜的冠军之位，当年在美国狂销二十八万册。目前，这《肖申克的救赎》已经被翻译成三十一种语言，同时创下了收录的四篇小说中有三篇被改编成轰动一时的电影的记录。其中最为人精精乐道的便是曾获奥斯卡奖七项提名、被称为电影史上最完美影片的《肖申克救赎》（又译《刺激一九九五》）。这部小说展现了斯蒂芬·金于擅长的惊悚题材之外的过人功力。书中的另两篇小说《纳粹高徒》与《尸体》拍成电影后也赢得了很好的口碑。其中《尸体》还被视为斯蒂芬·金具自传色彩的作品。'),(51,0,14,'肖申克的救赎','9787020054985','2022-07-12 02:54:36','2022-07-12 02:54:36','斯蒂芬·金（著）施寄青（译）',1,29.9,'　　《肖申克的救赎》是斯蒂芬·金最为人精精乐道的杰出代表作，收入了他的四部中篇小说。其英文版一经推出，即登上《纽约时报》畅销书排行榜的冠军之位，当年在美国狂销二十八万册。目前，这《肖申克的救赎》已经被翻译成三十一种语言，同时创下了收录的四篇小说中有三篇被改编成轰动一时的电影的记录。其中最为人精精乐道的便是曾获奥斯卡奖七项提名、被称为电影史上最完美影片的《肖申克救赎》（又译《刺激一九九五》）。这部小说展现了斯蒂芬·金于擅长的惊悚题材之外的过人功力。书中的另两篇小说《纳粹高徒》与《尸体》拍成电影后也赢得了很好的口碑。其中《尸体》还被视为斯蒂芬·金具自传色彩的作品。');
