INSERT INTO `isbn_library` VALUES (1,'http://static1.showapi.com/app2/isbn/img1/b35d7749526b4a7e850e22bed239978e.jpg','斯蒂芬·金（著）施寄青（译）','9787020054985','32开','平装','1','肖申克的救赎','','　　《肖申克的救赎》是斯蒂芬·金最为人精精乐道的杰出代表作，收入了他的四部中篇小说。其英文版一经推出，即登上《纽约时报》畅销书排行榜的冠军之位，当年在美国狂销二十八万册。目前，这《肖申克的救赎》已经被翻译成三十一种语言，同时创下了收录的四篇小说中有三篇被改编成轰动一时的电影的记录。其中最为人精精乐道的便是曾获奥斯卡奖七项提名、被称为电影史上最完美影片的《肖申克救赎》（又译《刺激一九九五》）。这部小说展现了斯蒂芬·金于擅长的惊悚题材之外的过人功力。书中的另两篇小说《纳粹高徒》与《尸体》拍成电影后也赢得了很好的口碑。其中《尸体》还被视为斯蒂芬·金具自传色彩的作品。','胶版纸','29.90','人民文学出版社','403','2006-07'),(2,'http://static1.showapi.com/app2/isbn/10/6a7c9030f4df4cadbb6093a813b1939a.jpg','布迪·克尼亚万（著）沈泽刚（著）','9787115525765','16开','平装-胶订','','Java BudiKurniawan','','本书基于新版的Java 11编写，全面系统地介绍Java程序员必须掌握的核心基础知识，这些内容融合在三大主题中——Java语言基础、面向对象编程以及Java核心类。其中，Java语言基础包括数据类型和运算符、控制结构、数组、类和对象、异常处理、枚举和注解等；面向对象包括封装性、继承性、多态性、接口与抽象类、泛型与集合、多线程与并发编程等；Java核心类包括日期时间API、输入\\/输出、JavaFX图形界面、Lambda表达式和Stream的使用、数据库和网络编程。本书还介绍了安全性和Java Web编程基础的相关知识。n','胶版纸','79.00','人民邮电出版社','','2020-06'),(7,'http://static1.showapi.com/app2/isbn/43/5a04da231c454a64858bec47dccc329a.jpg','明日科技','9787302581260','16开','平装-胶订','','Java从入门到精通','','《Java从入门到精通（第6版）》从初学者角度出发，通过通俗易懂的语言、丰富多彩的实例，详细讲解了使用Java语言进行程序开发需要掌握的知识。全书分为23章，内容包括初识Java，熟悉Eclipse开发工具，Java语言基础，流程控制，数组，类和对象，继承、多态、抽象类与接口，包和内部类，异常处理，字符串，常用类库，集合类，枚举类型与泛型，lambda表达式与流处理，I\\/O（输入\\/输出），反射与注释，数据库操作，Swing程序设计，Java绘图，多线程，网络通信，奔跑吧小恐龙，MR人脸识别打卡系统。书中所有知识都结合具体实例进行讲解，涉及的程序代码都给出了详细的注释，可以使读者轻松领会Java程序开发的精髓，快速提高开发技能。','胶版纸','79.80','清华大学出版社','','2021-07'),(8,'http://static1.showapi.com/app2/isbn/9/8f9fadd7e8ca4afcba3edb1ad9661ba9.jpg','张晓博','9787113261436','16开','平装-胶订','','Java学习笔记：从入门到实战 张晓博','','本书以学习笔记的形式循序渐进地讲解了使用Java语言的核心知识，并通过具体实例的实 n','胶版纸','59.80','中国铁道出版社有限公司','','2019-10'),(9,'http://static1.showapi.com/app2/isbn/10/b51b755880684cc7b1d35845398d244d.jpg','小甲鱼','9787115580931','16开','平装','','web   css3 html5web ','','','胶版纸','99.80','人民邮电出版社','','2022-02'),(10,'http://static1.showapi.com/app2/isbn/115/713b4e89111344bd970f3df169a56c9b.jpg','Robert（著）Kevin Wayne（著）谢路云（译）','9787115293800','16开','平装','4','算法（第4版）','','　　《算法（第4版）》全面讲述算法和数据结构的必备知识，具有以下几大特色。','胶版纸','99.00','人民邮电出版社','636','2012-10'),(11,'http://static1.showapi.com/app2/isbn/img/354597ae1f9043a9b790e43829771c2f.jpg','程杰（著）','9787302162063','16开','平装','1','大话设计模式','','　　本书通篇都是以情景对话的形式，用多个小故事或编程示例来组织讲解GoF（设计模式的经典名著——DesignPatterns：ElementsofReusableObject-OrientedSoftware，中译本名为《设计模式——可复用面向对象软件的基础》的四位作者ErichGamma、RichardHelm、RalphJohnson，以及JohnVlissides，这四人常被称为GangofFour，即四人组，简称GoF）总结的23个设计模式。本书共分为29章。其中，第1、3、4、5章着重讲解了面向对象的意义、好处以及几个重要的设计原则；第2章，以及第6到第28章详细讲解了23个设计模式；第29章是对设计模式的全面总结。附录部分是通过一个例子的演变为初学者介绍了面向对象的基本概念。本书的特色是通过小菜与大鸟的趣味问答，在讲解程序的不断重构和演变过程中，把设计模式的学习门槛降低，让初学者可以更加容易地理解——为什么这样设计才是好的？是怎样想到这样设计的？以达到不但授之以“鱼”，还授之以“渔”的目的。引导读者体会设计演变过程中蕴藏的大智慧。','胶版纸','45.00','清华大学出版社','368','2007-12'),(12,'http://static1.showapi.com/app2/isbn/10/a115138aa117410fbfa187b8c79747cc.jpg','乔国辉','9787302584667','16开','平装-胶订','','IntelliJ IDEA    ','','IntelliJ IDEA 是一款优秀的软件开发工具，学习和掌握IntelliJ IDEA对于开发者来讲具有十分重要的意义。本书以IntelliJ IDEA的操作使用为主线，同时贯穿示例教学，全面地向读者展示了其强大的开发与管理能力。本书为读者准备了比较全面的技术体系，共16章。第1章与第2章主要讲解了IntelliJ IDEA的使用技巧；第3章主要讲解了IntelliJ IDEA中的工程结构及组织方式；第4章与第5章主要讲解了IntelliJ IDEA下项目的编译、部署、运行与调试；第6章与第7章讲解了Maven等项目构建管理工具的使用；第8章Git版本管理是开发者需要着重学习的知识技能；第9章讲解了Spring项目的使用原理并深化了示例；第10章讲解了数据库管理工具的使用技巧；第11章至第14章进行了全方位的拓展，引入了Docker容器、Vue.js、Scala、Python等相关内容；第15章为辅助教学篇，主要讲解了持续化部署工具的使用；第16章为结束篇，以插件为主题从大方向讲解了IntelliJ IDEA下的插件开发。本书适用于所有初学者及具有一定开发经验的从业人员、软件爱好者。相信通过阅读本书，读者能够获得更多的帮助与提升。','胶版纸','139.00','清华大学出版社','','2021-10'),(13,'http://static1.showapi.com/app2/isbn/36/0fff13ad574942afabf65c00e2c5d539.jpg','摆玉龙（著）陈辉（著）范满红（著）','9787302539308','16开','平装-胶订','','WeDo2.0乐高机器人初级教程','','　　《WeDo2.0乐高机器人初级教程\\/STEM教育培训系列》主要介绍WeDo2.0乐高机器人套装、器件介绍、编程简介、WeDo2.0基础实验、WeDo2.0引导实验和WeDo2.0进阶实验，每个实验包括阅读与思考、设计与制作、程序编编看、拓展与提高、STEAM内涵和英语角等。《WeDo2.0乐高机器人初级教程\\/STEM教育培训系列》通过引导学生利用WeDo2.0零件搭建生活中常见的模型，探索生活中的科学原理，初步理解拉力、速度、电机、集线器等重要的自然科学概念。','胶版纸','59.00','清华大学出版社','',''),(14,'http://static1.showapi.com/app2/isbn/10/31616fc42e6742b59e1411d880557d6f.jpg','刘凤飞','9787302539728','16开','平装-胶订','','轻松玩转Scratch 3.0编程','','Scratch是可视化的编程语言，利用它可以制作游戏、动画，还可以计算数学题、处理字符串。　　《轻松玩转Scratch 3.0编程（第2版）》共分为五部分，细致入微地讲解Scratch3.0编程，完全不用担心孩子零基础。　　第一部分（第1、2章）了解Scratch3.0的界面和功能，以及与Scratch2.0的区别。　　第二部分（第3—16章）针对Scratch3.0中的每一个程序块进行实例讲解。　　第三部分（第17章）在掌握基础程序块的基础上，深刻理解和运用编程中的顺序执行、重复执行、条件判断等程序结构。　　第四部分（第18—22章）以一个个游戏项目作为实战案例，详细地讲解每一个项目的分析过程、角色安排、程序制作以及完成后的排错、改进思路和方案。　　第五部分（第23、24章）是高阶项目，一步一步地从简单的实现逐渐增加功能，最终完成一个极其挑战的程序模块，体验一个项目的迭代过程。　　《轻松玩转Scratch 3.0编程（第2版）》适合完全没有接触过编程的家长和小朋友阅读。对从事编程教育的老师来说，也是一本非常好的教程。　　120个趣味示例，系统讲解Scratch3.0常用模块的使用方法和技巧。Scratch是可视化的编程语言，利用它可以制作游戏、动画，还可以计算数学题、处理字符串。　　《轻松玩转Scratch 3.0编程（第2版）》共分为五部分，细致入微地讲解Scratch3.0编程，完全不用担心孩子零基础。　　第一部分（第1、2章）了解Scratch3.0的界面和功能，以及与Scratch2.0的区别。　　第二部分（第3—16章）针对Scratch3.0中的每一个程序块进行实例讲解。　　第三部分（第17章）在掌握基础程序块的基础上，深刻理解和运用编程中的顺序执行、重复执行、条件判断等程序结构。　　第四部分（第18—22章）以一个个游戏项目作为实战案例，详细地讲解每一个项目的分析过程、角色安排、程序制作以及完成后的排错、改进思路和方案。　　第五部分（第23、24章）是高阶项目，一步一步地从简单的实现逐渐增加功能，最终完成一个极其挑战的程序模块，体验一个项目的迭代过程。　　《轻松玩转Scratch 3.0编程（第2版）》适合完全没有接触过编程的家长和小朋友阅读。对从事编程教育的老师来说，也是一本非常好的教程。　　120个趣味示例，系统讲解Scratch3.0常用模块的使用方法和技巧。　　图解教学，学编程像搭积木，快乐动手，轻松有趣。　　创新教育从编程开始，动手培养逻辑思维能力。','胶版纸','89.00','清华大学出版社','','2020-01'),(15,'http://static1.showapi.com/app2/isbn/pic/b187d9f862684f9eabb5cc8167b49a5e.jpg','埃里克·马瑟斯','9787115546081','16开','平装-胶订','','Python编程 从入门到实践','','本书是针对所有层次Python读者而作的Python入门书。全书分两部分：*部分介绍用Python编程所必须了解的基本概念，包括强大的Python库和工具，以及列表、字典、if语句、类、文件与异常、代码测试等内容；第二部分将理论付诸实践，讲解如何开发三个项目，包括简单的2D游戏、利用数据生成交互式的信息图以及创建和定制简单的Web应用，并帮助读者解决常见编程问题和困惑。第2版进行了全面修订，简化了Python安装流程，新增了f字符串、get()方法等内容，并且在项目中使用了Plotly库以及新版本的Django和Bootstrap，等等。','胶版纸','89.00','人民邮电出版社','','2020-09'),(16,'http://static1.showapi.com/app2/isbn/img/2ed0a1ee29ac4d8f898772e1383db4aa.jpg','迈耶（著）侯妍（译）','9787508355948','16开','平装','1','CSS权威指南（第三版）','','　　你是否既想获得丰富复杂的网页样式，同时又想节省时间和精力？本书为你展示了如何遵循CSS全新规范（CSS2和CSS2.1）将层叠样式表的方方面面应用于实践。','胶版纸','58.00','中国电力出版社','508','2008-01'),(17,'http://static1.showapi.com/app2/isbn/512/b8c310416aca4e0f97c4cfc1c8fb9d6b.jpg','[美]Robin Nixon（罗宾?尼克松）','9787512381650','16开','平装','','PHP、MySQL与JavaScript学习手册（第四版）','','','胶版纸','128.00','中国电力出版社','','2015-12'),(18,'http://static1.showapi.com/app2/isbn/9/cc9302a0dce94497a38a7f8b8bff09b9.jpg','霍春阳','9787115583864','128开','平装','','Vuejs  HcySunYang   z','','','胶版纸','120.00','人民邮电出版社','','2022-02'),(19,'http://static1.showapi.com/app2/isbn/pic/25f21374a1e74209b3d8fd91f227ba77.jpg','史蒂芬·普拉达','9787115521637','16开','平装-胶订','','C Primer Plus 6    C','','《C Primer Plus（第6版）中文版》详细讲解了C语言的基本概念和编程技巧。 《C Primer Plus（第6版）中文版》共17章。第1章、第2章介绍了C语言编程的预备知识。第3章～第15章详细讲解了C语言的相关知识，包括数据类型、格式化输入\\/输出、运算符、表达式、语句、循环、字符输入和输出、函数、数组和指针、字符和字符串函数、内存管理、文件输入和输出、结构、位操作等。第16章、第17章介绍C预处理器、C库和高级数据表示。本书以丰富多样的程序为例，讲解C语言的知识要点和注意事项。每章末尾设计了大量复习题和编程练习，帮助读者巩固所学知识和提高实际编程能力。附录给出了各章复习题的参考答案和丰富的参考资料。 《C Primer Plus（第6版）中文版》可作为C语言的教材，适用于需要系统学习C语言的初学者，也适用于想要巩固C语言知识或希望进一步提高编程技术的程序员。','胶版纸','108.00','人民邮电出版社','','2019-11'),(20,'http://static1.showapi.com/app2/isbn/imgs/8ca0dbe0b4634fac81c6b9bfed586578.jpg','Goodfellow（著）Yoshua（著）Bengio（著）Aaron（著）Courville（著）','9787115461476','16开','平装-胶订','1','深度学习','','《深度学习》由全球知名的三位专家Ian Goodfellow、Yoshua Bengio 和Aaron Courville撰写，是深度学习领域奠基性的经典教材。全书的内容包括3个部分：第1部分介绍基本的数学工具和机器学习的概念，它们是深度学习的预备知识；第2部分系统深入地讲解现今已成熟的深度学习方法和技术；第3部分讨论某些具有前瞻性的方向和想法，它们被公认为是深度学习未来的研究重点。《深度学习》适合各类读者阅读，包括相关专业的大学生或研究生，以及不具有机器学习或统计背景、但是想要快速补充深度学习知识，以便在实际产品或平台中应用的软件工程师。','胶版纸','168.00','人民邮电出版社','500','2017-07'),(21,'http://static1.showapi.com/app2/isbn/115/54ca2a749daa413198b3600e74f04f0f.jpg','鸟哥','9787115472588','16开','平装-胶订','','鸟哥的Linux私房菜 基础学习篇','','畅销Linux入门书升级版 鸟哥教你从入门到精通 适用Linux系统应用和开发及运维的人员 涵盖linux内核 命令行 嵌入式 Shell与Shell Scripts技巧精粹 基于CentOS 7.x','胶版纸','118.00','人民邮电出版社','','2018-10'),(22,'http://static1.showapi.com/app2/isbn/pic/24ad64005e4546cd8bfbb9aacbd00ef1.jpg','克雷格·沃斯（著）张卫滨..（译）','9787115527929','16开','平装-胶订','','Spring实战','','本书是一本经典而实用的畅销Spring 学习指南。第5 版涵盖了Spring 5.0 和Spring Boot 2.0 里程碑式的 新。全书分为5 个部分，共19 章。  部分（ ～5 章）涵盖了构建Spring 应用的基础话题。第2 部分（第6～9章）讨论如何将Spring 应用与其他应用进行集成。第3 部分（ 0～12 章）探讨Spring对反应式编程提供的全新支持。第4 部分（ 3～15 章）拆分单体应用模型，介绍SpringCloud 和微服务开发。第5 部分（ 6～19 章）讨论如何为应用投入生产环境做准备以及如何进行部署。本书既适合刚开始学习Spring Boot 和Spring 框架的Java 开发人员快速上手，也适合经验丰富的Spring 开发人员学习Spring 的新特性，尤其适用于企业级Java 开发人员。','胶版纸','99.00','人民邮电','','2020-02'),(23,'http://static1.showapi.com/app2/isbn/pic/2850c6002ff4405c8c272fa5fedad90a.jpg','庞之浩','9787810756129','32开','','1','登天巴士','','','','','江西高校出版社','141页','2005'),(24,'http://static1.showapi.com/app2/isbn/511/a5876d0f3f164ae3ad16b776d818f062.jpg','俞敏洪','9787511041203','32开','平装-胶订','','四级词汇词根+联想记忆法:乱序版 cet4 大学英语四级词汇书 俞敏洪 赠精美笔记本【新东方专营店】','','《四级词汇词根 联想记忆法：乱序版》是俞敏洪老师编著的经典 词根 联想 系列词汇书之一，已陪伴数百万名考生走过备战四级的岁月，广受读者欢迎。 英语四级考试大纲要求考生掌握4000余个词汇以及相关词组，本书囊括四级新大纲词表所有新增词，删除新大纲词表中已经删除的词汇，紧跟新大纲改革趋势，匹配新版考试大纲词表。打破常规的按字母顺序排列单词的方式，以乱序编排带来学习的新体验。按照听力题型调整要求，本书总结归纳了四级新闻核心词汇，帮助考生从容应对新题型。编者还悉心整理了易考到的超纲单词、熟词僻义表、中学已学单词及词组、不规则动词表，总词汇量已远远超出大纲要求，能帮助广大考生从容应对四级考试中的各个题型，取得满意的成绩。 本书主体部分的核心单词分为35个学习单元，考生可依据自身情况合理安排进度，','胶版纸','48.00','海豚出版社','416','2017-12'),(25,'http://static1.showapi.com/app2/isbn/530/9ea805be94c44e4a8b40651f7bca3b10.jpg','路遥','9787530216774','32开','平装-胶订','1','平凡的世界普及本 路遥著','','这是一部现实主义小说，也是小说化的家族史。作家高度浓缩了中国西北农村的历史变迁过程，作品达到了思想性与艺术性的高度统一，特别是主人公面对困境艰苦奋斗的精神，对今天的大学生朋友仍有启迪。这是一部全景式地表现中国当代城乡社会生活的长篇小说，本书共三部。作者在近十年问广阔背景上，通过复杂的矛盾纠葛，刻划了社会各阶层众多普通人的形象。劳动与爱情，挫折与追求，痛苦与欢乐，日常生活与巨大社会冲突，纷繁地交织在一起，深刻地展示了普通人在大时代历史进程中所走过的艰难曲折的道路。\r这是《平凡的世界》（共三部）的精华版，在原书三本的基础上缩写为一本，内容更为集中。\r','胶版纸','39.80','北京十月文艺出版社','','2017-06'),(26,'http://static1.showapi.com/app2/isbn/pic/951c3599d19244d78aa7ee11edd7f17b.jpg','立人','9787513928649','16开','平装-胶订','','中国的十万个为什么 快乐读书吧','','','轻型纸','24.80','民主与建设出版社','','2020-02'),(27,'http://static1.showapi.com/app2/isbn/1910/a4b643e57f2b4f95bc29281a0b38e997.jpg','高士其','9787513928663','16开','平装-胶订','','灰尘的旅行 ','','','轻型纸','24.80','民主与建设出版社','','2020-02');
